<html>
	<head>
		<style>
			@import url(http://fonts.googleapis.com/css?family=Changa+One);	

			@-webkit-keyframes tilt {
				0%,100% {
					-webkit-transform: rotate(-20deg);
				}

				50%{
					-webkit-transform: rotate(40deg);
				}
				
			}
			
			@-webkit-keyframes rotate {
				0%,100% {
					-webkit-transform: rotate(0deg);
				}
				50%{
					-webkit-transform: rotate(360deg);
				}
			}
			
			@-webkit-keyframes expand {
				0%,100%{
					width:2em;
					height:2em;
					margin:0.5em;
					background:black;

				}
				50%{
					width:0.50em;
					height:0.50em;
					margin:1.25em;
					background:red;
				}
			}
			
			@-webkit-keyframes popout {
				0%{
				height:500px;
				width:500px;
				margin-top:-250px;
				margin-left:-250px;
				}
				40%,60% {
				height:0px;
				width:0px;
				margin:0px;
				font-size:0px;
				background: white;
				}
				100%{
				height:500px;
				width:500px;
				margin-top:-250px;
				margin-left:-250px;
				}
				
			}
			
			*{
				margin:0 0 0 0;
				padding:0 0 0 0;
			}
			
			main{
				height:300%;
				width:200%;
				margin-top:-50%;
				margin-left:-50%;
				-webkit-animation: rotate 48s infinite;
			}
			
			div{
				margin:0.5em;
				width:2em;
				height:2em;
				float:left;
				border-radius:100%;
				-webkit-animation: expand 12s infinite;
			}
			
			aside{
				height:500px;
				width:500px;
				margin-top:-250px;
				margin-left:-250px;
				position:fixed;
				top:50%;
				left:50%;
				text-align: center;
				color:white;
				border-radius:100%;
				background:black;
				-webkit-animation: tilt 6s infinite;
			}
			
			aside:hover{
			    -webkit-animation: popout 6s infinite;
			}
			
			h1{
				color:white;
				font-size:8em;
				margin:0.8em;
				font-family: 'Changa One';
				-webkit-transform: rotate(-10deg);
			}
				
		</style>
	</head>
